import http from "../http-common";

class UserManagementDataService {
  getAll() {
    return http.get("/user-management");
  }

  get(username) {
    return http.get(`/user-management/${username}`);
  }

  create(data) {
    return http.post("/user-management", data);
  }

  update(username, data) {
    return http.put(`/user-management/${username}`, data);
  }

  delete(username) {
    return http.delete(`/user-management/${username}`);
  }

  findByUsername(username) {
    return http.get(`/user-management?username=${username}`);
  }
}

export default new UserManagementDataService();
